		/* Try /usr/local/include/L */
		Tcl_DecrRefCount(fileObj);
		fileObj = Tcl_ObjPrintf("/usr/local/include/L/%s", file);
		Tcl_IncrRefCount(fileObj);
		f = include_try(fileObj, &found);
		if (found) goto done;
		/* Try /usr/include/L */
		Tcl_DecrRefCount(fileObj);
		fileObj = Tcl_ObjPrintf("/usr/include/L/%s", file);
